		///<summary>Deletes one EhrLab from the database.</summary>
		public static void Delete(long ehrLabNum) {
			string command="DELETE FROM ehrlab "
				+"WHERE EhrLabNum = "+POut.Long(ehrLabNum);
			Db.NonQ(command);
		}

		///<summary>Deletes many EhrLabs from the database.</summary>
		public static void DeleteMany(List<long> listEhrLabNums) {
			if(listEhrLabNums==null || listEhrLabNums.Count==0) {
				return;
			}
			string command="DELETE FROM ehrlab "
				+"WHERE EhrLabNum IN("+string.Join(",",listEhrLabNums.Select(x => POut.Long(x)))+")";
			Db.NonQ(command);
		}

